local Players = game:GetService("Players")
local player = Players.LocalPlayer

if player then
    -- Tạo GUI chính
    local gui = Instance.new("ScreenGui")
    gui.Name = "CustomWaitGUI"
    gui.ResetOnSpawn = false
    gui.Parent = player:WaitForChild("PlayerGui")

    local frame = Instance.new("Frame")
    frame.Size = UDim2.new(0, 400, 0, 120)
    frame.Position = UDim2.new(0.5, -200, 0.5, -60)
    frame.BackgroundColor3 = Color3.fromRGB(25, 25, 25)
    frame.BorderSizePixel = 2
    frame.BorderColor3 = Color3.fromRGB(255, 170, 0)
    frame.Parent = gui

    local label = Instance.new("TextLabel")
    label.Size = UDim2.new(1, -20, 1, -20)
    label.Position = UDim2.new(0, 10, 0, 10)
    label.BackgroundTransparency = 1
    label.TextColor3 = Color3.fromRGB(255, 170, 0)
    label.Font = Enum.Font.GothamBold
    label.TextSize = 20
    label.TextWrapped = true
    label.Parent = frame

    local milestoneEvents = {
        [150] = "🔓 Unlock: Auto Parry (No Miss) has been activated!",
        [120] = "🔓 Unlock: Skin Changer has been enabled!",
        [90]  = "🌀 Ability Cooldown Reduction incoming...",
        [60]  = "⚔️ Sword Trail Enhancer is preparing...",
        [30]  = "🌟 Final Boost loading... Stay focused!",
        [10]  = "🚀 Script is launching shortly!",
        [5]   = "🔥 Your power is ready... Unleash the fury!"
    }

    -- Hiển thị thông báo milestone với hiệu ứng phóng to thu nhỏ
    local function showMilestone(text)
        for i = 20, 14, -1 do
            label.TextSize = i
            wait(0.01)
        end

        label.Text = text

        for i = 14, 22 do
            label.TextSize = i
            wait(0.01)
        end

        wait(4) -- giữ thông báo lâu hơn 4 giây

        for i = 22, 20, -1 do
            label.TextSize = i
            wait(0.01)
        end
    end

    -- Hiện thông báo đầu tiên lâu hơn trước khi đếm ngược
    label.Text = "🔄 Syncing your data with the server to ensure fair play and smooth experience. Thanks for your patience."
    wait(5)  -- Giữ câu thông báo 5 giây

    coroutine.wrap(function()
        for i = 180, 1, -1 do
            local milestoneText = milestoneEvents[i]
            if milestoneText then
                showMilestone(milestoneText)
            else
                label.Text = "⏳ Script running... Please wait " .. i .. "s"
                label.TextSize = 20
            end
            wait(1)
        end
        gui:Destroy()
    end)()
end
